    void assertNumber (String formula, String result) {

        try {
            BigDecimal resultActual = CalculateFormula.calculateFormula(formula);
            BigDecimal resultExpected = new BigDecimal(result);
            assertEquals(resultExpected, resultActual);
        } catch (DivideZeroException | InvalidInputException | ResultUndefinedException | OperationException e) {
            assertEquals(result, e.getMessage());
        }

    }
